import React from 'react';
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from 'react-router-dom';
import {
  AppBar,
  Button,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  Toolbar
  } from '@material-ui/core';
import { withStyles } from '@material-ui/core/styles';
import {
    Apps as AppsIcon,
    Wifi as WifiIcon,
    Public as PublicIcon,
    Security as SecurityIcon
  } from '@material-ui/icons';

import ThreatMap from './ThreatMap';

const StyledButton = withStyles({
  root: {
    color: "white"
  }
})(Button);

function Dashboard(){
  return(
    <BrowserRouter>
      <AppBar color="primary" position="sticky">
        <Toolbar>
          <StyledButton component={Link} to="/">Demo App</StyledButton>
        </Toolbar>
      </AppBar>
      <div>
        <List>
          <ListItem>
            <ListItemIcon>
              <PublicIcon />
            </ListItemIcon>
            <ListItemText
                primary="Web Protection"/>
          </ListItem>
          <ListItem>
            <ListItemIcon>
              <AppsIcon />
            </ListItemIcon>
            <ListItemText primary="App Protection"/>
          </ListItem>
          <ListItem>
            <ListItemIcon>
              <WifiIcon />
            </ListItemIcon>
            <Button color="primary" component={Link} to="/network-threat-map">
                Network Protection
            </Button>
          </ListItem>
          <ListItem>
            <ListItemIcon>
              <SecurityIcon />
            </ListItemIcon>
            <ListItemText primary="System Protection" />
          </ListItem>
        </List>
        <Switch>
          <Route path='/network-threat-map'>
            <ThreatMap />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
};

export default Dashboard;
